import React, { } from 'react';


const PropertyListContainer = () => {
  const properties = [
    { id: 1, title: 'Modern Villa', location: 'Los Angeles', price: 500000, image: require('../assets/1.jpeg'), propertyType: 'Villa', bedrooms: 4 },
    { id: 2, title: 'Cozy Apartment', location: 'New York', price: 300000, image: require('../assets/2.jpeg'), propertyType: 'Apartment', bedrooms: 2 },
    { id: 3, title: 'Luxury House', location: 'Miami', price: 400000, image: require('../assets/3.jpeg'), propertyType: 'House', bedrooms: 3 },
    { id: 4, title: 'Spacious Condo', location: 'Seattle', price: 750000, image: require('../assets/4.jpeg'), propertyType: 'Condo', bedrooms: 3 },
    { id: 5, title: 'Charming Bungalow', location: 'Chicago', price: 650000, image: require('../assets/5.jpeg'), propertyType: 'Bungalow', bedrooms: 2 },
    { id: 6, title: 'Stylish Loft', location: 'San Francisco', price: 800000, image: require('../assets/6.jpeg'), propertyType: 'Loft', bedrooms: 1 },
  ];

  return (
    <section className="combined-listings">
      <h2>Properties</h2>
    
    </section>
  );
};

export default PropertyListContainer;
